description:
Atlee is the third DCU character to have earth manipulation powers and be called Terra.  This mini-series written by Jimmy Palmiotti and Justin Gray, with illustrations by Amanda Conner sets out her origins.  Atlee is a major character in the current Power Girl series.

As Terra's earth-shaking stunts grab the attention of the world, a new threat rises from beneath the surface. Will Terra live to fight another day, as she takes on the blaze and fury of Pyrite and the Lavarians? And what is the secret behind this new mover and shaker's powers?


